Plot: A young soldier, Kate, returns from a tour in Afghanistan after witnessing her boyfriend's tragic death in combat. With the comfort of her friends, including Torri (Barbara Nedeljacova), she takes the chance to get away on a camping trip to a picturesque, remote area of the British countryside. Wanting to escape their past, the girls begin their expedition into the woods for a peaceful break. As they near Sunset Point, they come across a strange and evasive group of locals who seem to be living off the land. During their journey they also have a friendly encounter with three charming, rock-climbing adventurers, led by Ethan (Ben Loyd Holmes). After the girls find themselves secluded again, Charlie (Jemma Bolt) goes suddenly goes missing, leaving the girls vulnerable in the dangerous woods. As darkness falls, the girls will be forced to rely on each other and their newly formed friendships to find Charlie before it becomes the last hike of their lives.

